import React from 'react';
import './MatchImage.css'; 
import vsImage from '../assets/vs.png'; 
function MatchImage() {
  return (
    <div className="match-image">
      <img src={vsImage} alt="VS" />
    </div>
  );
}

export default MatchImage;
